import React from 'react';
import { Container, Header, Grid, Image, List, Segment } from 'semantic-ui-react';
import PropTypes from 'prop-types';
import vk from '../../../Images/vk.png';
import got from '../../../Images/got.png';
import ghost from '../../../Images/ghost.png';

const HomepageHeading = ({ bool, children }) => {
  console.log("this is what =" + bool)
  return (
    <Container style={{width:'100%'}} className="custom_movieContentHeader">
      <Segment inverted vertical style={{ padding: '1px', margin: '0px' }} >
        {children}
        <Grid inverted stackable>
          <Grid.Row>
            <Grid.Column width={5} >
              <Header
                as='h2'
                content='Imagine-a-Company,'
                inverted
                style={{
                  fontSize: bool ? '1.5em' : '2em',
                  fontWeight: 'normal',
                  marginBottom: 0,
                  marginTop: bool ? '1em' : '1em',
                }}
              />
              SDFDSFSDFSDF<br/>
              SFSDF
              SDFDSFSDFSDF<br/>
              SFSDF
              SDFDSFSDFSDF<br/>
              SFSDF
              SDFDSFSDFSDF<br/>
              SFSDF
              SDFDSFSDFSDF<br/>
              SFSDF
            </Grid.Column>
            <Grid.Column width={11}>
              {/* <img class="ui fluid image" src={got}/> */}
              {/* <Image src={got} /> */}
            </Grid.Column>
          </Grid.Row>
        </Grid>
      </Segment>
    </Container>
  )
}

HomepageHeading.propTypes = {
  mobile: PropTypes.bool
}

export default HomepageHeading;
